import logo from './logo.svg';
import {useEffect, useState} from "react";
import './App.css';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function App() {
    const [data, setData] = useState([])

    useEffect(() => {
        Axios.get('https://jsonplaceholder.typicode.com/todos')
            .then(res => {
                console.log(res.data)
                setData(res.data)
            })
            .catch(err => console.log(err))
    }, [])

    const array = data.map((data, index) => {
        return (
            <div className="card card-custom bg-white border-white border-0">
                <div className="card-custom-img"
                     style="background-image: url(https://res.cloudinary.com/d3/image/upload/c_scale,q_auto:good,w_1110/trianglify-v1-cs85g_cc5d2i.jpg);"></div>
                <div className="card-custom-avatar">
                    <img className="img-fluid"
                         src="https://res.cloudinary.com/d3/image/upload/c_pad,g_center,h_200,q_auto:eco,w_200/bootstrap-logo_u3c8dx.jpg"
                         alt="Avatar"/>
                </div>
                <div className="card-body" style="overflow-y: auto">
                    <h4 className="card-title">Card title</h4>
                    <p className="card-text">Card has minimum height set but will expand if more space is needed for
                        card body content. You can use Bootstrap <a
                            href="https://getbootstrap.com/docs/4.0/components/card/#card-decks"
                            target="_blank">card-decks</a> to align multiple cards nicely in a row.</p>
                </div>
                <div className="card-footer" style="background: inherit; border-color: inherit;">
                    <a href="#" className="btn btn-primary">Option</a>
                    <a href="#" className="btn btn-outline-primary">Other option</a>
                </div>
            </div>

        )
    })
  return (
    <div className="App">
        {array}
    </div>


  );
}

export default App;
